    .spinner {
      width: 100px;
      height: 100px;

      position: relative;
      margin: 100px auto;

    .double-bounce1, .double-bounce2 {
      width: 100%;
      height: 100%;
      border-radius: 50%;
      background-color: #409EFF;
      opacity: 0.6;
      position: absolute;
      top: 0;
      left: 0;

      animation: sk-bounce 2.0s infinite ease-in-out;
    }

    .double-bounce2 {

      animation-delay: -1.0s;
    }

      0%, 100% { -webkit-transform: scale(0.0) }
      50% { -webkit-transform: scale(1.0) }
    }

      0%, 100% {
        transform: scale(0.0);

      } 50% {
